import React, { Component } from 'react';
import Search from "../containers/Search"
import axios from "axios"

const getArtist = () => {
  axios
      .get('/api/artists')
      .then(res => {   
      console.log(res.data)
      }
  )
}

class Home extends Component {

componentDidMount() {
  getArtist()
}

  render () {
    return (
      <>      
        <div className="home">
          <div className="home__background-image"></div>
        </div>
          <Search/>
      </>
    );
  }
}

export default Home;
